import { Container, Card, CardHeader, CardActions, CardContent, Button } from '@material-ui/core';
import Navbar from "./../components/navbar.js"

import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl';
import TextField from '@material-ui/core/TextField';

import IconButton from '@material-ui/core/IconButton';
import SearchIcon from '@material-ui/icons/Search';
import PersonPinCircleIcon from '@material-ui/icons/PersonPinCircle';

class App extends Component {
  handleNewUserMessage = (newMessage) => {
    console.log(`New message incomig! ${newMessage}`);
    // Now send the message throught the backend API
  }
  render() {
    var customStyle = {
      padding:"0",
      margin:"0",
      display: 'block',
      height: '97vh',
      background:'WhiteSmoke'
    }

    return (
      <div style={customStyle}>
        <div style={{display: 'flex', justifyContent:'center', alignItems:'center', padding:"1%"}}>
          <FormControl>
            <InputLabel htmlFor="input-address">Ubicaci√≥n</InputLabel>
            <Input
              id="input-addres"
              startAdornment={
                <InputAdornment position="start">
                  <PersonPinCircleIcon />
                </InputAdornment>
              }
            />
          </FormControl>
        </div>

      </div>

    );
  }
}

export default App;
